●P-GEL（踏み付け部）：発泡シートタイプ。薄くて、足あたりもソフト。
●アムフィット対応：足型を測定し、そのデータをもとに作られるカスタムメイドのインナーソール〈アムフィット〉対応シューズです。(対応サイズ:２２．５cm～３２．０cm)<br>●コストパフォーマンスの高い、GELオールコート用エントリーモデル。
●クッション性に優れたGELをかかと部へ搭載し、足腰への負担を軽減。
●オールコートに対応、エントリープレーヤーにおすすめの一足。
※オールコート用<br>●アッパー
・本体：人工皮革製+合成繊維製
・補強：人工皮革製
●アウターソール：ゴム底
●インナーソール：取替式
●適合する別売中敷：TIZ601<br>※商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br><br>
